script:
reset();

const size = 128;
const maxHeight = 20;
const offset = 64;
const radius = size * 0.5 - 0.5;

const map = [];
for (let x = 0, i = 0; x < size; x += 1) {
  for (let y = 0; y < 32; y += 1) {
    for (let z = 0; z < size; z += 1, i += 1) {
      const baseHeight = (radius - Math.sqrt(
        (x - radius) ** 2
        + (z - radius) ** 2
      )) * 0.2;
      const height = Math.floor(
       (
          Math.abs(noise.noise3d(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(noise.noise3d(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(noise.noise3d(x / 128, y / 64, z / 128)) * 0.4
        ) * (maxHeight + baseHeight)
      );
      map[i] = y <= height;
    }
  }
}

for (let x = 0, i = 0; x < size; x += 1) {
  for (let y = 0; y < 32; y += 1) {
    for (let z = 0; z < size; z += 1, i += 1) {
      let type = 0;
      if (map[i]) {
        if (y <= 6) {
          type = 2;
        } else {
          const top = y === 31 ? false : map[
            x * size * 32 + (y + 1) * size + z
          ];
          type = top ? 5 : 1;
        }
        update(x - offset, y, z - offset, type);
      }
    }
  }
}

const elevator = {
  x: -4,
  y: 12,
  z: -4,
};
box(
  elevator.x, elevator.y, elevator.z,
  8, 9, 8,
  3
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  4
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
